import React, { useState, useEffect } from 'react';

const NotHome = () => {
  // Step 1: Initialize state for the counter and the message
  const [counter, setCounter] = useState(0);
  const [message, setMessage] = useState('');

  // Step 2: Functions to handle increment and decrement
  const increment = () => setCounter(counter + 1);
  const decrement = () => setCounter(counter - 1);

  // Step 3: useEffect to handle side effects based on the counter value
  useEffect(() => {
    // If the counter goes below 0, reset it to 0
    if (counter < 0) {
      setCounter(0);
    }

    // If the counter exceeds 5, show the message
    if (counter > 5) {
      setMessage('You passed 5!');
    } else {
      setMessage('');
    }
  }, [counter]); // This effect runs every time the counter changes

  return (
    <div>
      <h1>Not Home Page</h1>
      <p>Counter: {counter}</p>
      {message && <p>{message}</p>}

      {/* Buttons to increment or decrement the counter */}
      <button onClick={increment}>Increase</button>
      <button onClick={decrement}>Decrease</button>
    </div>
  );
};

export default NotHome;
